  [],\n\t\"revision_timestamp\": \"2016-07-27T22:45:41.774609\",\n\t\"name\": \"kirtlands-warbler-wildlife-management-area-comprehensive-conservation-plan\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Comprehensive Conservation Plan (CCP)
  for Kirtlandu2019s Warbler Wildlife Management Area (WMA) was signed on September
  10, 2009, completing a planning process that began in 2006. Management highlights
  include: udbc0udc84Management of jack pine stands will shift toward a more ecologically-
  based approach that better emulates natural, wildfire-generated jack pine stands.
  udbc0udc84The Service will explore opportunities for land exchange and consolidation
  with the state of Michigan and possibly the U.S. Forest Service. The Service and
  others involved in Kirtlandu2019s Warbler recovery believe than consolidation could
  increase the total area of land managed for the warbler as well as increase efficiency
  for state and federal agencies. This summary includes a general description of how
  the WMA will be managed in the future. A table that begins on page 6 shows differences
  between previous management and the management direction under the CCP.\",\n\t\"license_title\":
